import React from "react";
import "./ChatMessage.scss";
import { Avatar } from "@mui/material";
const ChatMessage = () => {
  return (
    <div className="message">
      <Avatar />
      <div className="messageInfo">
        <h4>
          shin code
          <span className="messageTimestanp">2022/12/28</span>
        </h4>
      </div>
    </div>
  );
};

export default ChatMessage;
